import ReactDOM from 'react-dom';

const AppList = () => {
  return (
    <ul>
      <li>My first list</li>
      <li>My first list</li>
    </ul>
  );
}


const el = (
<>
<h1>Hello World!</h1>
<AppList />
<AppList />
</>
);

ReactDOM.render(el, document.getElementById('root'));
